    true,nt"url": null,nt"notes": "Condition of Public School Facilities, 2012-13
    (FRSS 105), is a study that is part of the Fast Response Survey System (FRSS) program;
    program data is available since 1998-99 at http://nces.ed.gov/surveys/frss/downloads.asp
    that will provide national data about the condition of public schools in 2012 based
    on a survey conducted by NCES. FRSS 105 (http://nces.ed.gov/surveys/frss/index.asp)
    is a cross-sectional survey that collects and report data on key education issues
    at the elementary and secondary levels. The study was conducted using questionnaires
    of principals. Schools in September 2012 were sampled. The study's weighted response
    rate was 90 percent. Key statistics produced from FRSS 105 will provide information
    about the condition of school facilities and the costs to bring them into good condition;
    school plans for repairs, renovations, and replacements; the age of public schools;
    and school improvements to increase energy efficiency.",nt"license_title":
